import React, { useState } from "react";
import styles from './Login.scss'; // import folosind module CSS
import { Button, TextField, Typography, Container, Grid, InputAdornment, IconButton, Checkbox, FormControlLabel } from "@mui/material";
import { AccountCircle, Visibility, VisibilityOff } from "@mui/icons-material";

function Login() {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");
    const [showPassword, setShowPassword] = useState(false);
    const [isSignUp, setIsSignUp] = useState(false);
    const [isForgotPassword, setIsForgotPassword] = useState(false);
    const [isLoggedIn, setIsLoggedIn] = useState(false); // Stare pentru a gestiona autentificarea

    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [confirmPassword, setConfirmPassword] = useState("");
    const [acceptConditions, setAcceptConditions] = useState(false);

    const handleClickShowPassword = () => setShowPassword((show) => !show);

    const handleSubmit = (e) => {
        e.preventDefault();
        if (isSignUp) {
            console.log("First Name:", firstName);
            console.log("Last Name:", lastName);
            console.log("Username:", username);
            console.log("Password:", password);
            console.log("Confirm Password:", confirmPassword);
            console.log("Accept Conditions:", acceptConditions);
            // Logica pentru înregistrare aici
        } else {
            // Simulăm autentificarea cu succes pentru username-ul specificat
            if (username === "bolocancrinamaria13@gmail.com" && password === "mail") {
                setIsLoggedIn(true); // Setăm starea de autentificare
                setIsLogin(true); // Apelăm funcția setIsLogin pentru a actualiza starea de autentificare în componenta părinte
            } else {
                alert("Invalid username or password. Please try again.");
            }
        }
    };

    const handleSwitchToSignUp = () => {
        setIsSignUp(true);
    };

    const handleSwitchToLogin = () => {
        setIsSignUp(false);
    };

    const handleForgotPassword = () => {
        setIsForgotPassword(true);
    };

    if (isLoggedIn) {
        return null; // Redirecționează către pagina de proiecte când utilizatorul este autentificat
    }

  return (
    <div className={styles.loginContainer}>
      <div className={styles.titleWrapper}>
        <div className={styles.title}>CREATE</div>
        <span className={styles.description}>
          Embedding advanced urban material stock methods within governance
          processes to enable circular economy and cities resilience
        </span>
      </div>
      <Container component="main">
        <Grid container spacing={2} alignItems="center">
            <Grid item xs={12}>
                <Typography variant="body1" className={styles.label}>
                    Username/Email
                </Typography>
                <TextField
                    variant="outlined"
                    margin="normal"
                    required
                    fullWidth
                    id="username"
                    name="username"
                    autoFocus
                    value={username}
                    onChange={(e) => setUsername(e.target.value)}
                    InputProps={{
                        startAdornment: (
                            <InputAdornment position="end">
                                <AccountCircle />
                            </InputAdornment>
                        ),
                    }}
                />
            </Grid>
        </Grid>
        <Grid container spacing={2} alignItems="center">
            <Grid item xs={12}>
                <Typography variant="body1" className={styles.label}>
                    Password
                </Typography>
                <TextField
                    variant="outlined"
                    margin="normal"
                    required
                    fullWidth
                    name="password"
                    type={showPassword ? "text" : "password"}
                    id="password"
                    autoComplete="current-password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    InputProps={{
                        startAdornment: (
                            <InputAdornment position="start">
                                <IconButton
                                    aria-label="toggle password visibility"
                                    onClick={handleClickShowPassword}
                                    edge="end"
                                >
                                    {showPassword ? <VisibilityOff /> : <Visibility />}
                                </IconButton>
                            </InputAdornment>
                        ),
                    }}
                />
                <Button onClick={handleForgotPassword} className={styles.forgotPasswordLink}>
                    Forgot Password?
                </Button>
            </Grid>
        </Grid>
        <Grid container spacing={2} alignItems="center">
            <Grid item xs={12}>
                <Button type="submit" className={`${styles.signInButton} customSignInButton`}>
                    Sign In
                </Button>
                <Button onClick={handleSwitchToSignUp} className={`${styles.signUpButton} customSignUpButton`}>
                    Sign Up
                </Button>
            </Grid>
        </Grid>
        </Container>
    </div>
  );
}

export default Login;
